import {NavLink } from "react-router-dom";

export default function AppRouter() {
  return (
    <div className="header">
        <nav>
            <ul>
                <li><NavLink to="/" className="active">Home</NavLink></li>
                <li><NavLink to="/bio" className="active">Biography</NavLink></li>
                <li><NavLink to="/knowledge" className="active">Knowledge</NavLink></li>
                <li><NavLink to="/projects" className="active">Projects</NavLink></li>
                <li><NavLink to="/contact" className="active">Contact</NavLink></li>
            </ul>
        </nav>
    </div>
    
  )
}
